import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { TelaPerguntasComponent } from './tela-perguntas/tela-perguntas.component'; // Importe o componente TelaPerguntasComponent aqui

@NgModule({
  declarations: [
    AppComponent,
    TelaPerguntasComponent // Certifique-se de incluir o componente TelaPerguntasComponent aqui
  ],
  imports: [
    BrowserModule,
    HttpClientModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
